      string: '{"id":1573,"page":1,"results":[{"author":"talisencrw","author_details":{"name":"","username":"talisencrw","avatar_path":null,"rating":9.0},"content":"Great
        fun re-watching this after checking out the original for the first time. One
        of the very best filmic franchises out there, to be sure.","created_at":"2016-08-13T20:39:17.279Z","id":"57af8575925141289d006f7a","updated_at":"2021-06-23T15:57:50.257Z","url":"https://www.themoviedb.org/review/57af8575925141289d006f7a"},{"author":"GenerationofSwine","author_details":{"name":"","username":"GenerationofSwine","avatar_path":"/xYhvrFNntgAowjRsf6mRg9JgITr.jpg","rating":10.0},"content":"I
        was 10 in 1990, I loved Die Hard, and I hated Die Hard 2.\r\n\r\nNow I''m
        40 and I am rewatching this and.... compared to movies today it is pretty
        good. If this was made in 2020 it would be a 10 out of 10 star smash blockbusting
        hit that all of America raves about except the \"everything is political all
        the time crowd.\"\r\n\r\nBut it didn''t, it came out in 1990 and because of
        that it was a subpar sort of BS action movie that in no way lived up to the
        first one.\r\n\r\nThe thing is... I''m writing the review in 2020. Today it''s
        a good movie if you compare it to most everything in the theaters today and
        especially to the new Die Hard movies.","created_at":"2023-01-12T01:13:45.233Z","id":"63bf5ec9df857c008140c16f","updated_at":"2023-01-12T01:13:45.308Z","url":"https://www.themoviedb.org/review/63bf5ec9df857c008140c16f"},{"author":"CinemaSerf","author_details":{"name":"CinemaSerf","username":"Geronimo1967","avatar_path":"/1kks3YnVkpyQxzw36CObFPvhL5f.jpg","rating":7.0},"content":"If
        anyone were ever to need to write a training manual for terrorists that demonstrated
        how to maximise the chaos and destruction at a facility; then they could do
        a great deal worse than engage the services of Bruce Willis. In this cracking
        action adventure film, he is \"Lt. John McClane\" who finds himself amidst
        a hijacking - but this time it''s not the plane that''s being hijacked, it''s
        the whole airport - and all so a drug-dealing general can escape justice with
        the help of some rogue highly trained military types. Willis has bags of charisma,
        and he needs it as he has to persuade sceptical authorities and other cops
        of the critical risk - and all before an incoming flight carrying his wife
        (with quite a fun little sub-plot of it''s own) runs out of fuel. The dialogue
        is sometimes quite pithy, and Tom Bower is fine as \"Marvin\" (the janitor
        who gets roped in too). It does lack menace, maybe Willis'' style of characterisation
        is just a bit too laid back; the smile and the glint - but it''s still an
        end to end action thriller with plenty of pyrotechnics and near misses to
        fill a couple of hours in a world of mindless cinema. It''s not quite as good
        at the first one, but there''s not that much to it.","created_at":"2023-08-26T06:29:03.702Z","id":"64e99bafc3c891013ab24c89","updated_at":"2023-08-26T06:29:03.802Z","url":"https://www.themoviedb.org/review/64e99bafc3c891013ab24c89"}],"total_pages":1,"total_results":3}'
